import React from "react";
import Detail from "../../data/detail.json";
const DelailList = () => {
  return (
    <div>
      {Detail.map((callback, index) => (
        <div>
          <h1>{callback.name}</h1>
          <button>Reserve or Book Now</button>
          <p>{callback.address}</p>
          <h4>{callback.distance}</h4>
          <h4>{callback.price}</h4>
          <img src={callback.photos} alt={Detail.index}></img>
          <h1>{callback.title}</h1>
          <p>{callback.description}</p>
        </div>
      ))}
    </div>
  );
};
export default DelailList;
